import { Navigate } from 'react-router-dom'

const authProtectedRoutes = [
  {
    path: '/',
    exact: true,
    component: <Navigate to="/tickets" />,
    permissions: [permissions.ticketList],
  },
  // Flow metrics dashboard path
  {
    path: '/dashboard/flow-metrics',
    component: <FlowMetricsPage />,
    permissions: [permissions.dashboardFlow],
  },
  {
    path: '/dashboard/ticket-sold',
    component: <ConvertionReportPage />,
    permissions: [permissions.dashboardTicketSold],
  },

  // Assesors Report Dashboard path
  {
    path: '/dashboard/assesors-report',
    component: <AssesorsReportPage />,
    permissions: [permissions.dashboardManager],
  },
  // Executive Report Dashboard path
  {
    path: '/dashboard/executive-report',
    component: <ExecutiveReportPage />,
    permissions: [permissions.dashboardExecutive],
  },

  // Companies Inbound Dashboard path
  {
    path: '/dashboard/companies-inbound',
    component: <CompaniesInboundPage />,
    permissions: [permissions.dashboardCampaign],
  },
  {
    path: '/dashboard/tickets',
    component: <TicketsReportPage />,
    permissions: [permissions.dashboardTicket],
  },
  {
    path: '/dashboard/leads',
    component: <LeadsReportPage />,
    permissions: [permissions.dashboardLead],
  },

  //ticket path
  { path: '/tickets', component: <Ticket />, permissions: [permissions.ticketList] },
  {
    path: '/tickets',
    component: <Navigate to="/tickets" />,
    permissions: [permissions.ticketList],
  },

  // Details ticket path
  {
    path: '/tickets/:id',
    component: <TicketDetailsPage />,
    permissions: [permissions.ticketDetail],
  },
  // ELIMINAR DESPUES
  {
    path: '/tickets/tickets-download',
    component: <TicketsLogPage />,
    permissions: [permissions.ticketExport],
  },

  //citas path
  { path: '/citas', component: <Citas />, permissions: [permissions.ticketCalendar] },
  {
    path: '/citas',
    component: <Navigate to="/citas" />,
    permissions: [permissions.ticketCalendar],
  },

  // Soporte path
  { path: '/support', component: <SupportPage />, permissions: [permissions.support] },
  {
    path: '/support',
    component: <Navigate to="/support" />,
    permissions: [permissions.support],
  },

  // Soporte Details path
  { path: '/support/:id', component: <SupportDetailsPage />, permissions: [permissions.support] },
  {
    path: '/support/:id',
    component: <Navigate to="/support/:id" />,
    permissions: [permissions.support],
  },

